import React from 'react';

const AddressList = () => (
  <div>
    <h1 className="fs-3 fw-semibold mb-3">Sổ địa chỉ</h1>
    <p className="fs-6">Chức năng sổ địa chỉ đang được phát triển.</p>
  </div>
);

export default AddressList;
